import React from "react";
import { Col } from "react-bootstrap";
import Form from "react-bootstrap/Form";

const BannerTypes = ({ populateBannerText }) => {
  return (
    <Col lg="6">
      <div className="banner-control banner-control-types">
        <h5>Banner Types</h5>
        <p>Select your desirable layout.</p>
        <b>hello world</b>
        <Form.Select aria-label="Default select example">
          {/* <option>Choose your Banner Type.</option> */}
          <option value="1">Facebook Cover</option>
          <option value="2">Facebook Post</option>
          <option value="3">Instagram Wrapper</option>
          <option value="3">Instagram Post</option>
        </Form.Select>
      </div>
    </Col>
  );
};

export default BannerTypes;
